package finddog.model.vo;

public class DogList {
	String age;
	String careAddr;
	String careNm;
	String careTel;
	String colorCd;
	String filename;
	String happenDt;
	String happenPlace;
	String kindCd;
	String noticeNo;
	String noticeEdt;
	String orgNm;
	String sexCd;
	String specialMark;
	String weight;
	public DogList() {
		super();
		// TODO Auto-generated constructor stub
	}
	public DogList(String age, String careAddr, String careNm, String careTel, String colorCd, String filename,
			String happenDt, String happenPlace, String kindCd, String noticeNo, String noticeEdt, String orgNm,
			String sexCd, String specialMark, String weight) {
		super();
		this.age = age;
		this.careAddr = careAddr;
		this.careNm = careNm;
		this.careTel = careTel;
		this.colorCd = colorCd;
		this.filename = filename;
		this.happenDt = happenDt;
		this.happenPlace = happenPlace;
		this.kindCd = kindCd;
		this.noticeNo = noticeNo;
		this.noticeEdt = noticeEdt;
		this.orgNm = orgNm;
		this.sexCd = sexCd;
		this.specialMark = specialMark;
		this.weight = weight;
	}
	public String getAge() {
		return age;
	}
	public void setAge(String age) {
		this.age = age;
	}
	public String getCareAddr() {
		return careAddr;
	}
	public void setCareAddr(String careAddr) {
		this.careAddr = careAddr;
	}
	public String getCareNm() {
		return careNm;
	}
	public void setCareNm(String careNm) {
		this.careNm = careNm;
	}
	public String getCareTel() {
		return careTel;
	}
	public void setCareTel(String careTel) {
		this.careTel = careTel;
	}
	public String getColorCd() {
		return colorCd;
	}
	public void setColorCd(String colorCd) {
		this.colorCd = colorCd;
	}
	public String getFilename() {
		return filename;
	}
	public void setFilename(String filename) {
		this.filename = filename;
	}
	public String getHappenDt() {
		return happenDt;
	}
	public void setHappenDt(String happenDt) {
		this.happenDt = happenDt;
	}
	public String getHappenPlace() {
		return happenPlace;
	}
	public void setHappenPlace(String happenPlace) {
		this.happenPlace = happenPlace;
	}
	public String getKindCd() {
		return kindCd;
	}
	public void setKindCd(String kindCd) {
		this.kindCd = kindCd;
	}
	public String getNoticeNo() {
		return noticeNo;
	}
	public void setNoticeNo(String noticeNo) {
		this.noticeNo = noticeNo;
	}
	public String getNoticeEdt() {
		return noticeEdt;
	}
	public void setNoticeEdt(String noticeEdt) {
		this.noticeEdt = noticeEdt;
	}
	public String getOrgNm() {
		return orgNm;
	}
	public void setOrgNm(String orgNm) {
		this.orgNm = orgNm;
	}
	public String getSexCd() {
		return sexCd;
	}
	public void setSexCd(String sexCd) {
		this.sexCd = sexCd;
	}
	public String getSpecialMark() {
		return specialMark;
	}
	public void setSpecialMark(String specialMark) {
		this.specialMark = specialMark;
	}
	public String getWeight() {
		return weight;
	}
	public void setWeight(String weight) {
		this.weight = weight;
	}
	
	
	
	
	
}
